import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import '../App.css';
import {
    CardGroup, Card, CardImg, CardBody, CardTitle, CardSubtitle, CardText, Button
} from 'reactstrap';

//<div className='App-header'>
//<h1>Caíste, no me podés pedir nada. Todavía no funciono =)</h1>
//</div>
/*  
barks con almendras y cada cual con los tres choco
con galletitas oreo
con sal marina
con cereales
con menta
tulipas de chocolate
las tabletas
semiesferas de chocolate con ddl
milhojas de ddl

tableta con cereales
tableta con caramelo
tableta con menta
trufa con frutos del bosque
minihuevitos blancos
minihuevitos semiamargo
minihuevitos leche
 */
/* 
<div key='contenedor-componentes'>
{artesanias.map((artesania) => (
    <div key={artesania[0]} className='App-header'>
        <p>{artesania[0]}</p>
        <p>{artesania[1]}</p>
    </div>
))}
</div>
 */
const artesanias = [
    [
        'Bombón con ganasch',
        'url de ganasch',
        'Pasen y vean qué lindas tolderías',
        'Descripción de la toldería'
    ],
    [
        'Tableta con cereales',
        'url de tableta de cereales'
    ]
]

const Componente = () => {
    return (
        <CardGroup>
            <Card>
                <CardImg
                    alt="Img ilustrativa"
                    src="https://cdn.shopify.com/s/files/1/0247/3731/6909/products/Chocolateartesanal_almendra05_cuadrado_1024x1024.jpg?v=1633796874"
                    top
                    width="10%"
                />
                <CardBody>
                    <CardTitle tag="h5">
                        {artesanias[0][0]}
                    </CardTitle>
                    <CardSubtitle
                        className="mb-2 text-muted"
                        tag="h6"
                    >
                        {artesanias[0][2]}
                    </CardSubtitle>
                    <CardText>
                        {artesanias[0][3]}
                    </CardText>
                    <Button>
                        Button
                    </Button>
                </CardBody>
            </Card>
        </CardGroup>
    )
}

export const Pedido = () => {
    return (
        <div>
            <Componente />
        </div>
    )
}
